root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);


const express = require ('express');
const cors = require ('cors');
const { MongoClient } = require('mongodb');

const app = new express();
app.use(express.json());
app.use(cors());

const client = new MongoClient("mongodb+srv://admin:admin@cluster19.45u7uh1.mongodb.net/?retryWrites=true&w=majority")
client.connect();
const db =client.db('mswdsrp')
const col = db.collection('registration data')

app.get('/home', (req, res)=> {
    res.send("Home Page");
})

app.post('/insert', (req, res)=>{
    console.log(req.body);
    col.insertOne(req.body);
    res.send("successfully received");
})

app.get('/showall', async(req,res) => {
    const result  = await col.find(). toArray();
    res.send(result);
})
